    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Noto+Sans&display=swap" rel="stylesheet">

    <style>
        .tippy-box[data-theme~=my-tooltip-theme-1] {
            font-family: 'Noto Sans', sans-serif;
            border-radius: 5px;
            opacity: 0.75;
            background-color:black;
        }

        .tippy-box[data-theme~=my-tooltip-theme-1][data-placement^=top] > .tippy-arrow:before{
            border-top-color: black;
        }

        .tippy-box[data-theme~=my-tooltip-theme-1][data-placement^=bottom] > .tippy-arrow:before{
            border-bottom-color: black;
        }

        .tippy-box[data-theme~=my-tooltip-theme-1][data-placement^=left] > .tippy-arrow:before{
            border-left-color: black;
        }

        .tippy-box[data-theme~=my-tooltip-theme-1][data-placement^=right] > .tippy-arrow:before{
            border-right-color: black;
        }

        .tippy-box[data-theme~=my-tooltip-theme-1] a {
            color: white;
            text-decoration: underline;
        }

        .tippy-box[data-theme~=my-tooltip-theme-2] {
            font-family: 'Noto Sans', sans-serif;
            border-radius: 50%;
            background-color:rgb(0.0, 153.0, 255.0);
            color: white;
        }

        .tippy-box[data-theme~=my-tooltip-theme-2][data-placement^=top] > .tippy-arrow:before{
            border-top-color:rgb(0.0, 153.0, 255.0)
        }

        .tippy-box[data-theme~=my-tooltip-theme-2][data-placement^=bottom] > .tippy-arrow:before{
            border-bottom-color:rgb(0.0, 153.0, 255.0)
        }

        .tippy-box[data-theme~=my-tooltip-theme-2][data-placement^=left] > .tippy-arrow:before{
            border-left-color:rgb(0.0, 153.0, 255.0)
        }

        .tippy-box[data-theme~=my-tooltip-theme-2][data-placement^=right] > .tippy-arrow:before{
            border-right-color:rgb(0.0, 153.0, 255.0)
        }

        .table-of-contents,
        .table-of-contents ul {
            list-style: none;
            margin: 0;
            padding: 0;
            margin-left: 0.8em;
        }

        .table-of-contents li {
            margin: 0;
            padding: 0 0.5em;
            line-height: 1.5em;
            color: rgb(180, 180, 180);
            border-left: 1px solid white;
        }

        .table-of-contents li:last-child {
            border-left: none;
        }

        .table-of-contents li::before {
            position: relative;
            top: -0.3em;
            height: 1em;
            width: 0.5em;
            color: white;
            border-bottom: 1px solid white;
            content: "";
            display: inline-block;
            left: -0.5em;
        }

        .table-of-contents li:last-child::before {
            border-left: 1px solid white;
        }

        .table-of-contents a {
            color: white;
        }

        // Base background color for monochrome
        const BASE_BACKGROUND_COLOR = 'rgb(30, 60, 192)';
        let interpolateColor = chroma.scale(['rgb(255, 255, 255)', chroma(BASE_BACKGROUND_COLOR).darken(3.5).rgb()]).domain([0.0, 1.0]);

        // Monochrome flag
        const MONOCHROME_FLAG_NAME = 'm-plus-plugin-monochrome-flag-for-diagram-map';
        let isMonochrome = localStorage.getItem(MONOCHROME_FLAG_NAME) === 'true';

        // Get query parameter
        const getQueryParam = (param) => new URLSearchParams(window.location.search).get(param);

        // Get query parameter from navigation entry
        const navigationEntries = performance.getEntriesByType('navigation');

        // Override monochrome flag if navigating and query parameter is specified
        if (navigationEntries.length > 0 && navigationEntries[0].type === 'navigate'
            && getQueryParam('theme') === 'monochrome') {
            isMonochrome = true;
        }

        // Monochromatize svg data
        if (isMonochrome) {

            // Remove background color (white fill and stroke)
            svgStringData = svgStringData.replace(/fill:white; stroke:white;/g, 'fill:none; stroke:none;');

            const monochromizeRgbValue = (value) => {
                let match = value.match(/rgb\((\d+),(\d+),(\d+)\)/);
                if (match) {
                    let red = parseInt(match[1]);
                    let green = parseInt(match[2]);
                    let blue = parseInt(match[3]);
                    if (!isNaN(red) && red >= 0 && red <= 255 &&
                        !isNaN(green) && green >= 0 && green <= 255 &&
                        !isNaN(blue) && blue >= 0 && blue <= 255) {

                        let color = chroma(`rgb(${red},${green},${blue})`);
                        let l = color.hsl()[2]; // Get L value (lightness) of HSL
                        return interpolateColor(l).css();
                    }
                }
                return value;
            };
            svgStringData = svgStringData.replaceAll(/rgb\((\d+),(\d+),(\d+)\)/g, monochromizeRgbValue);

            const monochromizeHexValue1 = (value) => {
                let match = value.match(/(fill|stroke):([a-zA-Z0-9#]+);/);
                if (match) {
                    let fillOrStroke = match[1];
                    let colorName = match[2];
                    if (colorName === 'none') {
                        return value;
                    } else {
                        let color = chroma(colorName);
                        let l = color.hsl()[2]; // Get L value (lightness) of HSL
                        return fillOrStroke + ':' + interpolateColor(l).css() + ';';
                    }
                }
                return value;
            };
            svgStringData = svgStringData.replaceAll(/(fill|stroke):([a-zA-Z0-9#]+);/g, monochromizeHexValue1);

            const monochromizeHexValue2 = (value) => {
                let match = value.match(/(fill|stroke)=\"([a-zA-Z0-9#]+)\"/);
                if (match) {
                    let fillOrStroke = match[1];
                    let colorName = match[2];
                    if (colorName === 'none') {
                        return value;
                    } else {
                        let color = chroma(colorName);
                        let l = color.hsl()[2]; // Get L value (lightness) of HSL
                        return fillOrStroke + '=' + interpolateColor(l).css() + '"';
                    }
                }
                return value;
            };
            svgStringData = svgStringData.replaceAll(/(fill|stroke)=\"([a-zA-Z0-9#]+)\"/g, monochromizeHexValue2);
        }

        const FOREGROUND_COLOR = isMonochrome ? interpolateColor(0.0) : 'rgb(0, 0, 0)';
        const BACKGROUND_COLOR = isMonochrome ? interpolateColor(1.0) : 'rgb(255, 255, 255)';
        const HIGHLIGHT_1_COLOR = isMonochrome ? interpolateColor(0.0) : 'rgb(255, 128, 0)';
        const HIGHLIGHT_2_COLOR = isMonochrome ? interpolateColor(0.0) : 'rgb(0, 153, 255)';

        const MEDIUM_COLOR = chroma.mix(FOREGROUND_COLOR, BACKGROUND_COLOR, 0.5);
        const MINIMUM_SCALE = 0.05;                     // Minimum zoom scale
        const MAXIMUM_SCALE = 80.0;                     // Maximum zoom scale

            ];

                .attr('stop-color', d => d.color);

            // Apply gradient to the entire screen
            svg.insert('rect', 'g')

                .attr('height', windowHeight)
                .attr('fill', 'url(#linear-gradient)');

        // --------
        // FUNCTION: Create a sliding description
        // --------
        function createSlidingDescription(desc, startingPosX, startingPosY, pathId) {

            // Temporarily create a text and get the text length
            let tmpDesc = svg.append('text')
                .attr('font-family', '"Noto Sans", sans-serif')
                .attr('font-size', '16px')
                .text(desc);
            let descWidth = tmpDesc.node().getComputedTextLength();
            tmpDesc.remove();

            // Create a path using the text length
            svg.append('path')
                .attr('id', pathId)
                .attr('d', 'M 0 16 L ' + descWidth + ' 16')
                .attr('stroke-width', 0)
                .attr('transform', 'translate(' + startingPosX + ',' + startingPosY + ')');

            // Create a rectangle behind the description
            let descRect = svg.append('rect')
                .attr('width', 0)
                .attr('height', 22)
                .attr('fill', BACKGROUND_COLOR)
                .attr('fill-opacity', 0.9)
                .attr('stroke-width', 0)
                .style('filter', 'blur(2px)')
                .attr('transform', 'translate(' + startingPosX + ',' + startingPosY + ')');

            // Create a text and set the path
            let descText = svg.append('text')
                .append('textPath')
                .attr('xlink:href', '#' + pathId)
                .attr('startOffset', -descWidth)
                .attr('font-family', '"Noto Sans", sans-serif')
                .attr('font-size', '16px')
                .attr('fill', FOREGROUND_COLOR)
                .attr('stroke-width', 0)
                .text(desc);
            
            return {descWidth, descRect, descText}
        }

        // --------
        // FUNCTION: Create display contents on the screen
        // --------
        function createDisplayContents(channel) {

            // Draw rectangle highlights
            for (rectangle of offsetHighlightData.rectangles) {

                if (rectangle.visible) {

                    // Draw highlights on the front layer
                    let frontLayerRectangle = svg.select('#front-layer')
                        .append('rect')
                        .attr('data-guid-of-model', rectangle.guidOfModel)
                        .attr('data-guid-of-diagram', rectangle.guidOfDiagram)
                        .attr('data-guids-to-link', rectangle.guidsToLink.join(','))   // Combine multiple GUIDs to link with commas
                        .attr('x', rectangle.x)
                        .attr('y', rectangle.y)
                        .attr('width', rectangle.width)
                        .attr('height', rectangle.height)
                        .attr('fill', BACKGROUND_COLOR)
                        .attr('fill-opacity', 0.0)
                        .attr('stroke-width', 10.0)
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 1.0)        // Since the front layer is set to semi-transparent, no transparency is set here
                        .on('mouseover', function () {
                            // Send the guid via the BroadcastChannel API
                            if (channel !== null) {
                                channel.postMessage(this.dataset.guidOfModel);
                            }

                            // Draw highlights on the middle-1 layer
                            svg.select('#middle-1-layer')
                                .append('rect')
                                .attr('id', 'temporary_highlight')
                                .attr('x', this.attributes.x.nodeValue)
                                .attr('y', this.attributes.y.nodeValue)
                                .attr('width', this.attributes.width.nodeValue)
                                .attr('height', this.attributes.height.nodeValue)
                                .attr('fill', BACKGROUND_COLOR)
                                .attr('fill-opacity', 0.0)
                                .attr('stroke-width', 15.0)
                                .attr('stroke', HIGHLIGHT_1_COLOR)
                                .attr('stroke-opacity', 0.5)
                                .transition()
                                .duration(250)
                                .attr('stroke-width', 10.0);

                            // Collect link destinations with the same GUID
                            let destGuidsToLink = this.dataset.guidsToLink.split(',');    // Split multiple GUIDs to link by comma

                            // Start point of the link
                            let linkStartPointX = this.x.baseVal.value + (this.width.baseVal.value * 0.5);
                            let linkStartPointY = this.y.baseVal.value + (this.height.baseVal.value * 0.5);

                            // Draw highlights of the link destination
                            drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink);
                        })
                        .on('mouseout', function () {
                            // Send an empty message via the BroadcastChannel API
                            if (channel !== null) {
                                channel.postMessage('');
                            }

                            // Remove temporary highlights
                            removeTemporaryHighlights();
                        });

                    // Create a tooltip using the Tippy library
                    if (rectangle.tooltip) {
                        tippy(frontLayerRectangle.nodes(), {
                            content: '<div style="font-size:16px; line-height:1.5em">' + rectangle.tooltip + '</div>',
                            allowHTML: true,
                            interactive: true,
                            appendTo: document.body,
                            arrow: true,
                            placement: 'top',
                            maxWidth: 'none',
                            theme: 'my-tooltip-theme-1',
                            onShow(instance) {
                                // Show when the toggle button is ON
                                return isToggleButtonOn;
                            },
                        });
                    }
                }
            }

            // Draw line highlights
            for (line of offsetHighlightData.lines) {

                if (line.visible) {
                    // Create a line path
                    let linePath = d3.path();
                    linePath.moveTo(line.points[0].x, line.points[0].y);
                    if (line.isCurve) {
                        // In the case of curve line
                        if (line.points.length == 2) {
                            linePath.lineTo(line.points[1].x, line.points[1].y);
                        } else if (line.points.length == 4) {
                            linePath.bezierCurveTo(line.points[1].x, line.points[1].y, line.points[2].x, line.points[2].y, line.points[3].x, line.points[3].y);
                        } else {
                            // If the number of points on the line is other than 2 or 4, it is incorrect.
                            continue;
                        }
                    } else {
                        // In the case of straight line
                        for (let i = 1; i < line.points.length; i++) {
                            linePath.lineTo(line.points[i].x, line.points[i].y);
                        }
                    }

                    // Draw highlights on the front layer
                    let frontLayerLine = svg.select('#front-layer')
                        .append('path')
                        .attr('data-guid-of-diagram', line.guidOfDiagram)
                        .attr('data-guids-to-link', line.guidsToLink.join(','))   // Combine multiple GUIDs to link with commas
                        .attr('d', linePath)
                        .attr('fill', 'none')
                        .attr('stroke-width', 15.0)
                        .attr('stroke-linecap', 'butt')
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 1.0)        // Since the front layer is set to semi-transparent, no transparency is set here
                        .on('mouseover', function () {

                            // Draw highlights on the middle-1 layer
                            svg.select('#middle-1-layer')
                                .append('path')
                                .attr('id', 'temporary_highlight')
                                .attr('d', this.attributes.d.nodeValue)
                                .attr('fill', 'none')
                                .attr('stroke-width', 20.0)
                                .attr('stroke-linecap', 'butt')
                                .attr('stroke', HIGHLIGHT_1_COLOR)
                                .attr('stroke-opacity', 0.5)
                                .transition()
                                .duration(250)
                                .attr('stroke-width', 15.0);

                            // Collect link destinations with the same GUID
                            let destGuidsToLink = this.dataset.guidsToLink.split(',');    // Split multiple GUIDs to link by comma

                            // Start point of the link
                            let linkNode = frontLayerLine.node();
                            let midpointOfLink = linkNode.getPointAtLength(linkNode.getTotalLength() / 2);
                            let linkStartPointX = midpointOfLink.x;
                            let linkStartPointY = midpointOfLink.y;

                            // Draw highlights of the link destination
                            drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink);
                        })
                        .on('mouseout', function () {
                            // Remove temporary highlights
                            removeTemporaryHighlights();
                        });

                    // Create a tooltip using the Tippy library
                    if (line.tooltip) {
                        tippy(frontLayerLine.nodes(), {
                            content: '<div style="font-size:16px; line-height:1.5em">' + line.tooltip + '</div>',
                            allowHTML: true,
                            interactive: true,
                            appendTo: document.body,
                            arrow: true,
                            followCursor: 'initial',
                            maxWidth: 'none',
                            theme: 'my-tooltip-theme-1',
                            onShow(instance) {
                                // Show when the toggle button is ON
                                return isToggleButtonOn;
                            },
                        });
                    }
                }
            }
        }

        // --------
        // FUNCTION: Offset positions of the highlight base data
        // --------
        function offsetHighlights(highlightBaseData, offsetData) {
            // Make a copy of the argument
            let retHighlightData = JSON.parse(JSON.stringify(highlightBaseData))

            for (diagramOffset of offsetData.diagramOffsets) {
                // Extract rectangles with the same GUID
                let extractedRectangles = retHighlightData.rectangles.filter(function (item, index) {
                    if (diagramOffset.guid === item.guidOfDiagram) return true;
                });

                // Offset the extracted rectangle positions
                for (extractedRectangle of extractedRectangles) {
                    extractedRectangle['x'] += diagramOffset.x;
                    extractedRectangle['y'] += diagramOffset.y;
                }

                // Extract lines with the same GUID
                let extractedLines = retHighlightData.lines.filter(function (item, index) {
                    if (diagramOffset.guid === item.guidOfDiagram) return true;
                });

                // Offset the extracted line positions
                for (extractedLine of extractedLines) {
                    for (point of extractedLine.points) {
                        point['x'] += diagramOffset.x;
                        point['y'] += diagramOffset.y;
                    }
                }
            }

            return retHighlightData
        }

        // --------
        // FUNCTION: Fucus on a rectangle with the specified GUID
        // --------
        function focusOn(guid) {
            // Extract rectangles with the same GUID
            let extractedRectangles = offsetHighlightData.rectangles.filter(function (item, index) {
                if (guid === item.guid) return true;
            });

            // Check the size of the extracted rectangles
            if (extractedRectangles.length === 0) {
                alert('Hyperlink destination cannot be found.');
                return;
            }

            // The first extracted rectangle is the destination rectangle
            let destRectangle = extractedRectangles[0];

            let scale = Math.min(windowWidth / destRectangle.width, windowHeight / destRectangle.height);
            scale = Math.max(scale, MINIMUM_SCALE);     // Do not allow less than minimum
            scale = Math.min(scale, MAXIMUM_SCALE);     // Do not allow greater than maximum

            // Move the center of the destination rectangle to the center of the window and scale
            let centerXofDestRectangle = (destRectangle.x + (destRectangle.width * 0.5)) * scale;
            let centerYofDestRectangle = (destRectangle.y + (destRectangle.height * 0.5)) * scale;
            let centerXofBrowser = windowWidth * 0.5;
            let centerYofBrowser = windowHeight * 0.5;
            svg.transition().duration(1500).ease(d3.easeSinOut).call(zoom.transform, d3.zoomIdentity
                .translate(centerXofBrowser - centerXofDestRectangle, centerYofBrowser - centerYofDestRectangle)
                .scale(scale));
        }

        // --------
        // FUNCTION: Draw highlights of the link destination
        // --------
        function drawHighlightsOfTheLink(linkStartPointX, linkStartPointY, destGuidsToLink) {

            // Extract rectangles of the link destination
            let destRectangles = offsetHighlightData.rectangles.filter(function (item, index) {
                for (srcRectangleGuidToLink of item.guidsToLink) {
                    for (destGuidToLink of destGuidsToLink) {
                        if (srcRectangleGuidToLink && destGuidToLink && srcRectangleGuidToLink === destGuidToLink) return true;
                    }
                }
            });

            // Draw rectangle highlights
            for (destRectangle of destRectangles) {

                // Draw highlights on the middle-1 layer
                svg.select('#middle-1-layer')
                    .append('rect')
                    .attr('id', 'temporary_highlight')
                    .attr('x', destRectangle.x)
                    .attr('y', destRectangle.y)
                    .attr('width', destRectangle.width)
                    .attr('height', destRectangle.height)
                    .attr('fill', BACKGROUND_COLOR)
                    .attr('fill-opacity', 0.0)
                    .attr('stroke-width', 15.0)
                    .attr('stroke', HIGHLIGHT_1_COLOR)
                    .attr('stroke-opacity', 0.5)
                    .transition()
                    .duration(250)
                    .attr('stroke-width', 10.0);

                // End point of a link to draw
                let linkEndPointX = destRectangle.x + (destRectangle.width * 0.5);
                let linkEndPointY = destRectangle.y + (destRectangle.height * 0.5);

                // Draw a link if the start and end points are not close
                if (Math.abs(linkStartPointX - linkEndPointX) > 1
                    || Math.abs(linkStartPointY - linkEndPointY) > 1) {

                    // Draw highlights on the middle-1 layer
                    svg.select('#middle-1-layer')
                        .append('line')
                        .attr('id', 'temporary_highlight')
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkStartPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkStartPointY)
                        .attr('stroke-width', 0.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 0.5)
                        .style('filter', 'blur(1px)')
                        .transition()
                        .duration(150)
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkEndPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkEndPointY)
                        .attr('stroke-width', 20.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 0.2);
                }
            }

            // Extract lines of the link destination
            let destLines = offsetHighlightData.lines.filter(function (item, index) {
                for (srcLinkGuidToLink of item.guidsToLink) {
                    for (destGuidToLink of destGuidsToLink) {
                        if (srcLinkGuidToLink && destGuidToLink && srcLinkGuidToLink === destGuidToLink) return true;
                    }
                }
            });

            // Draw line highlights
            for (destLine of destLines) {

                // Create a line path
                let linePath = d3.path();
                linePath.moveTo(destLine.points[0].x, destLine.points[0].y);
                if (destLine.isCurve) {
                    // In the case of curve line
                    if (destLine.points.length == 2) {
                        linePath.lineTo(destLine.points[1].x, destLine.points[1].y);
                    } else if (destLine.points.length == 4) {
                        linePath.bezierCurveTo(destLine.points[1].x, destLine.points[1].y, destLine.points[2].x, destLine.points[2].y, destLine.points[3].x, destLine.points[3].y);
                    } else {
                        // If the number of points on the line is other than 2 or 4, it is incorrect.
                        continue;
                    }
                } else {
                    // In the case of straight line
                    for (let i = 1; i < destLine.points.length; i++) {
                        linePath.lineTo(destLine.points[i].x, destLine.points[i].y);
                    }
                }

                // Draw highlights on the middle-1 layer
                let middle1LayerLink = svg.select('#middle-1-layer')
                    .append('path')
                    .attr('id', 'temporary_highlight')
                    .attr('d', linePath)
                    .attr('fill', 'none')
                    .attr('stroke-width', 20.0)
                    .attr('stroke-linecap', 'butt')
                    .attr('stroke', HIGHLIGHT_1_COLOR)
                    .attr('stroke-opacity', 0.5)
                    .transition()
                    .duration(250)
                    .attr('stroke-width', 15.0);

                // End point of a link to draw
                let linkNode2 = middle1LayerLink.node();
                let midpointOfLink = linkNode2.getPointAtLength(linkNode2.getTotalLength() / 2);
                let linkEndPointX = midpointOfLink.x;
                let linkEndPointY = midpointOfLink.y;

                // Draw a link if the start and end points are not close
                if (Math.abs(linkStartPointX - linkEndPointX) > 1
                    || Math.abs(linkStartPointY - linkEndPointY) > 1) {

                    // Draw highlights on the middle-1 layer
                    svg.select('#middle-1-layer')
                        .append('line')
                        .attr('id', 'temporary_highlight')
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkStartPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkStartPointY)
                        .attr('stroke-width', 0.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 0.5)
                        .style('filter', 'blur(1px)')
                        .transition()
                        .duration(150)
                        .attr('x1', linkStartPointX)
                        .attr('x2', linkEndPointX)
                        .attr('y1', linkStartPointY)
                        .attr('y2', linkEndPointY)
                        .attr('stroke-width', 20.0)
                        .attr('stroke-linecap', 'round')
                        .attr('stroke', HIGHLIGHT_1_COLOR)
                        .attr('stroke-opacity', 0.2);
                }
            }
        }

        // --------
        // FUNCTION: Create a BroadcastChannel and add an event listener
        // --------
        function createBroadcastChannel() {
            let channel = null;
            if (typeof BroadcastChannel !== 'undefined') {

                // Create a BroadcastChannel
                channel = new BroadcastChannel('m-plus-plugin-channel');

                // Add an event listener
                channel.addEventListener('message', (e) => {

                    // Remove temporary highlights
                    removeTemporaryHighlights();

                    // Remove temporary tooltips
                    removeTemporaryTooltips();

                    if (e.data === '') {
                        return;
                    }

                    // Select elements corresponding to the GUID from the front layer
                    let selectedElementsExternally = svg.select('#front-layer').selectAll('[data-guid-of-model="' + e.data + '"]');

                    if (selectedElementsExternally.size() <= 0) {
                        return;
                    }

                    // Draw highlights on the middle-2 layer
                    for (selectedElementExternally of selectedElementsExternally) {
                        let temporaryHighlight = svg.select('#middle-2-layer')
                            .append(function () {
                                // Copy the selected elements
                                return d3.select(selectedElementExternally).node().cloneNode(true);
                            })
                            .attr('id', 'temporary_highlight')
                            .attr('fill', BACKGROUND_COLOR)
                            .attr('fill-opacity', 0.0)
                            .attr('stroke-width', 15.0)
                            .attr('stroke', HIGHLIGHT_2_COLOR)
                            .attr('stroke-opacity', 0.5)
                            .transition()
                            .duration(250)
                            .attr('stroke-width', 10.0);
                        
                        let temporaryTooltip = tippy(temporaryHighlight.node(), {
                            content: 'Here',
                            showOnCreate: true,
                            appendTo: document.body,
                            arrow: true,
                            placement: 'top',
                            theme: 'my-tooltip-theme-2',
                        });
                        temporaryTooltips.push(temporaryTooltip);
                    }
                });
            }

            return channel;
        }

        // --------
        // FUNCTION: Remove temporary highlights
        // --------
        function removeTemporaryHighlights() {
            // Fade out and remove the temporarily highlights
            d3.selectAll('#middle-1-layer,#middle-2-layer')
                .selectAll('#temporary_highlight')
                .attr('id', '')     // Clear IDs to avoid multiple removals for the same element
                .transition()
                .duration(500)
                .attr('stroke-opacity', 0.0)
                .remove();
        }

        // --------
        // FUNCTION: Remove temporary tooltips
        // --------
        function removeTemporaryTooltips() {
            for (temporaryTooltip of temporaryTooltips) {
                temporaryTooltip.destroy();
            }
        }
    </script>
</body>
</html>
